import React from 'react';

export default function Foot() {
    return (
        <div className='topLayer footer'>
            <h5 className='subText'>Hiragana Heroes/"Be A Weeb" designed and built by:</h5>
            <h4 className='subText'>Michael Farrell, Justin Abreu, and Alexander Hogle</h4>
        </div>
    )
}
